In my latest article for @travelandleisure digital, I'm sharing the 12 best small towns in the U.S. for families to visit.

The featured destinations include an island in Ohio, the waterpark capital of the world, one of the 15 best cities in the U.S., a town with 2 national parks, and a town with the biggest Christmas store in the world!

What other towns would you add to the list? Share your favorites in the comments below. ⤵

